 // SPDX-License-Identifier: MIT

pragma solidity < 0.8.0;
pragma abicoder v2;

import "./libs/SimpleAccessControl.sol";
import "./ERC20Capped.sol";

contract ERC20Crowdsale is SimpleAccessControl, ERC20Capped {

    uint256 private _crowdsaleRate = 0.00025 ether;
    uint256 private _nominalRate = 0.0005 ether;

    constructor(string memory _name, string memory _symbol) 
        ERC20Capped(_name, _symbol)
    {}

    function mintCrowdsale(uint256 _amount) external payable isAuthorizedERC1155 {
        uint256 value = _amount * _crowdsaleRate / 10**decimals();
        require(value <= msg.value, 'ERC20Crowdsale: ERR_NOT_ENOUGH_FUNDS');
        _mintCapped(msg.sender, _amount);
    }

    function mintNominal(uint256 _amount) public payable {
        require(_amount >= 2000, 'ERC20Crowdsale: ERR_MIN_AMOUNT');
        uint256 value = _amount * _nominalRate / 10**decimals();
        require(value <= msg.value, 'ERC20Crowdsale: ERR_NOT_ENOUGH_FUNDS');
        _mintCapped(msg.sender, _amount);
    }

    function transferToERC1155(address sender, uint256 amount)
        external
        isAuthorizedERC1155
        returns (bool)
    {
        _transfer(sender, _authorizedERC1155, amount);
        return true;
    }

    function withdrawBalance() public isOwner {
        uint256 _balance = address(this).balance;
        payable(_owner).transfer(_balance);
    }
}
